import{_ as e,o as a,c as i,Q as s}from"./chunks/framework.b637c96f.js";const g=JSON.parse('{"title":"zip命令","description":"","frontmatter":{},"headers":[],"relativePath":"Linux/zip.md","filePath":"Linux/zip.md","lastUpdated":1694800248000}'),p={name:"Linux/zip.md"},l=s('<h1 id="zip命令" tabindex="-1">zip命令 <a class="header-anchor" href="#zip命令" aria-label="Permalink to &quot;zip命令&quot;">​</a></h1><blockquote><p><code>zip</code>和<code>unzip</code>是在Linux和Unix系统上用于创建和提取ZIP文件的命令行工具。ZIP文件是一种常见的归档格式，可以压缩和存档多个文件和目录。</p></blockquote><h3 id="语法" tabindex="-1">语法 <a class="header-anchor" href="#语法" aria-label="Permalink to &quot;语法&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">zip [选项] [归档文件名] [文件或目录...]</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">zip [选项] [归档文件名] [文件或目录...]</span></span></code></pre></div><h3 id="选项" tabindex="-1">选项 <a class="header-anchor" href="#选项" aria-label="Permalink to &quot;选项&quot;">​</a></h3><ul><li><code>-r</code>：递归地包含目录及其内容。</li><li><code>-q</code>：静默模式，不显示操作过程。</li><li><code>-9</code>：使用最高压缩级别。</li><li><code>-j</code>：仅压缩文件，不包含目录结构。</li><li><code>-u</code>：仅更新归档文件中已存在的文件。</li><li><code>-d</code>：从归档文件中删除指定的文件。</li><li><code>-v</code>：显示详细信息，即在操作过程中显示文件名。</li></ul><h3 id="示例" tabindex="-1">示例 <a class="header-anchor" href="#示例" aria-label="Permalink to &quot;示例&quot;">​</a></h3><ol><li><p>创建一个名为<code>archive.zip</code>的ZIP文件，包含文件<code>file1.txt</code>和<code>file2.txt</code>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">zip archive.zip file1.txt file2.txt</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">zip archive.zip file1.txt file2.txt</span></span></code></pre></div></li><li><p>创建一个名为<code>archive.zip</code>的ZIP文件，包含目录<code>directory</code>及其内容：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">zip -r archive.zip directory</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">zip -r archive.zip directory</span></span></code></pre></div></li><li><p>创建一个使用最高压缩级别的ZIP文件<code>archive.zip</code>，包含目录<code>directory</code>和文件<code>file.txt</code>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">zip -9 archive.zip directory file.txt</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">zip -9 archive.zip directory file.txt</span></span></code></pre></div></li><li><p>更新已存在的ZIP文件<code>archive.zip</code>，添加文件<code>file3.txt</code>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">zip -u archive.zip file3.txt</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">zip -u archive.zip file3.txt</span></span></code></pre></div></li></ol><h2 id="unzip命令" tabindex="-1">unzip命令 <a class="header-anchor" href="#unzip命令" aria-label="Permalink to &quot;unzip命令&quot;">​</a></h2><p><code>unzip</code>命令用于从ZIP文件中提取文件和目录。</p><h3 id="语法-1" tabindex="-1">语法 <a class="header-anchor" href="#语法-1" aria-label="Permalink to &quot;语法&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">unzip [选项] [归档文件名]</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">unzip [选项] [归档文件名]</span></span></code></pre></div><h3 id="选项-1" tabindex="-1">选项 <a class="header-anchor" href="#选项-1" aria-label="Permalink to &quot;选项&quot;">​</a></h3><ul><li><code>-l</code>：显示归档文件中的内容列表，而不提取文件。</li><li><code>-q</code>：静默模式，不显示操作过程。</li><li><code>-o</code>：覆盖已存在的文件。</li><li><code>-d 目录</code>：指定提取文件的目标目录。</li></ul><h3 id="示例-1" tabindex="-1">示例 <a class="header-anchor" href="#示例-1" aria-label="Permalink to &quot;示例&quot;">​</a></h3><ol><li><p>提取ZIP文件<code>archive.zip</code>中的所有文件到当前目录：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">unzip archive.zip</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">unzip archive.zip</span></span></code></pre></div></li><li><p>提取ZIP文件<code>archive.zip</code>中的所有文件到指定目录<code>destination</code>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">unzip archive.zip -d destination</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">unzip archive.zip -d destination</span></span></code></pre></div></li><li><p>显示ZIP文件<code>archive.zip</code>中的内容列表：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">unzip -l archive.zip</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">unzip -l archive.zip</span></span></code></pre></div></li><li><p>提取ZIP文件<code>archive.zip</code>中的单个文件<code>file1.txt</code>：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">unzip archive.zip file1.txt</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">unzip archive.zip file1.txt</span></span></code></pre></div></li></ol>',16),c=[l];function o(t,d,n,r,h,u){return a(),i("div",null,c)}const z=e(p,[["render",o]]);export{g as __pageData,z as default};
